package profiles

func profileIcon(loader string) string {
	// god bless (kriminell)
	if loader == "fabric" {
		return "data:image/png;base64,"
	} else if loader == "quilt" {
		return "data:image/png;base64,\\u003d\\u003d"
	} else if loader == "forge" {
		return "data:image/png;base64,\\u003d"
	}

	return ""
}
